import React, { Component } from "react";
import { Table, Button } from "reactstrap";
import AddProfile from "./AddProfile";
import axios from "axios";
export default class Profile extends Component {
  constructor(props) {
    super(props);
    this.state = {
      users: [],
    };
  }

  componentDidMount() {
    this.getUsers();
  }
  getUser() {
    axios.get(`api/api/register`).then((response) => {
      if (response.status === 200) {
        this.setState({
          users: response.data.data ? response.data.data : [],
        });
      }
      if (
        response.data.status === "failed" &&
        response.data.success === false
      ) {
        this.setState({
          noDataFound: response.data.message,
        });
      }
    });
  }

  render() {
    const { noDataFound, users } = this.state;
    let usersDetails = [];
    if (users.length) {
      usersDetails = users.map((item,index) => {
        return (
          <tr key={item.id}>
            <td>{index}</td>
            <td>{item.first_name}</td>
            <td>{item.last_name}</td>
            <td>{item.full_name}</td>
            <td>{item.email}</td>
            <td>{item.phone}</td>
            <td>
              <Button color="success" className="mr-3" size="sm">
                Edit
              </Button>
              <Button color="danger" size="sm">
                Delete
              </Button>
            </td>
          </tr>
        );
      });
    }

    return (
      <div className="App container mt-4">
        <h4 className="font-weight-bold">users Registration</h4>
        <Profile />
        <Table>
          <thead>
            <tr>
              <th>#</th>
              <th>First Name</th>
              <th>Last Name</th>
              <th>Full Name</th>
              <th>Email</th>
              <th>Phone</th>
              <th>Actions</th>
            </tr>
          </thead>
          {users.length === 0 ? (
            <tbody>
              <h3>{noDataFound}</h3>
            </tbody>
          ) : (
            <tbody>{usersDetails}</tbody>
          )}
        </Table>
      </div>
    );
  }
}
